// Play overlay: fullscreen iframe with header and stats integration
(function () {
  const NAME = 'ui.play';
  const mods = (window.__builderModules = window.__builderModules || {});
  if (mods[NAME]) return;

  function createPlayOverlay() {
    const overlay = document.createElement('div');
    overlay.style.position = 'fixed';
    overlay.style.left = '0';
    overlay.style.top = '0';
    overlay.style.width = '100%';
    overlay.style.height = '100%';
    overlay.style.background = 'black';
    overlay.style.zIndex = 150000;
  overlay.style.display = 'flex';
  overlay.style.flexDirection = 'column';

  const iframe = document.createElement('iframe');
  iframe.style.flex = '1 1 auto';
  iframe.style.border = 'none';
  iframe.style.width = '100%';
  iframe.style.height = '100%';

  overlay._iframe = iframe;
  overlay.appendChild(iframe);
    return overlay;
  }

  let overlay = null;
  let headerEl = null;
  let currentUrl = '';

  async function open(input) {
    if (!input) return false;
    const isUrl = (s) => typeof s === 'string' && /^(https?:)?\/\//.test(s);
    let playUrl = null;

    if (isUrl(input)) {
      playUrl = input;
    } else {
      let games = null;
      try {
        if (window.Builder && typeof window.Builder.fetchGames === 'function') {
          games = await window.Builder.fetchGames();
          try { if (Array.isArray(games)) window.__lastFetchedGames = games; else if (games && Array.isArray(games.games)) window.__lastFetchedGames = games.games; } catch (e) {}
        } else if (window.__builderModules && window.__builderModules.apiClient && typeof window.__builderModules.apiClient.fetchGames === 'function') {
          games = await window.__builderModules.apiClient.fetchGames();
          try { if (Array.isArray(games)) window.__lastFetchedGames = games; else if (games && Array.isArray(games.games)) window.__lastFetchedGames = games.games; } catch (e) {}
        }
      } catch (e) {
        games = null;
      }

      try {
        if (games && typeof games === 'object' && Array.isArray(games.games)) games = games.games;
      } catch (e) {}

      if (!games) {
        try {
          const embedded = window.__embeddedData && (window.__embeddedData['data/games.json'] || window.__embeddedData['data/games.sample.json']);
          if (embedded) games = embedded.games || embedded;
        } catch (e) {}
      }

  let selectedGame = null;
  if (games && Array.isArray(games)) {
        // try numeric id match first
        const asNum = Number(input);
        let game = null;
        if (!Number.isNaN(asNum)) {
          game = games.find(g => Number(g.id) === asNum);
        }
        // fallback to title match (case-insensitive)
        if (!game && typeof input === 'string') {
          const q = input.toLowerCase();
          game = games.find(g => (g.title || '').toLowerCase() === q);
        }
  if (game) {
    if (game.playUrl) playUrl = game.playUrl;
    selectedGame = game;
    let verifyOwnership = true;
    try {
      const cfg = window.__embeddedData && window.__embeddedData['data/config.json'];
      if (cfg && cfg.verifyOwnership === false) verifyOwnership = false;
    } catch (e) {}

    try {
      if (selectedGame && typeof window.initOwns === 'function') {
        const shouldVerifyEarly = !!(selectedGame.appid || selectedGame.steam_appid || selectedGame.steamAppId || selectedGame.requiresSteam) && verifyOwnership;
        if (shouldVerifyEarly) {
          try { console.debug('play.open: early verify', selectedGame); } catch (e) {}
          const okEarly = await window.initOwns(selectedGame);
          if (!okEarly) {
            try {
              const modal = window.__builderModules && window.__builderModules['ui.modal'];
              if (modal && typeof modal.showModal === 'function') modal.showModal({ error: 'Ownership verification failed. You do not own this game.'});
            } catch (e) {}
            return false;
          }
        }
      }
    } catch (e) {}

    if (!game.playUrl) {
      try {
        const modal = window.__builderModules && window.__builderModules['ui.modal'];
        if (modal && typeof modal.showModal === 'function') modal.showModal({ error: 'No playUrl for game', game: game });
      } catch (e) {}
      try { console.warn('Play.open: found game but no playUrl', game); } catch (e) {}
    }
  }
      }
    }

    try {
      const isAbs = typeof playUrl === 'string' && /^(https?:)?\/\//.test(playUrl);
      if (!isAbs) {
        let candidates = [];
        try {
          const b = (window.Builder && typeof window.Builder.getFlag === 'function') ? window.Builder.getFlag('apiBase') : null;
          if (b) candidates.push(String(b));
        } catch (e) {}
        try { if (window.__builderFlags && window.__builderFlags.apiBase) candidates.push(String(window.__builderFlags.apiBase)); } catch (e) {}
        try {
          const cfg = window.__embeddedData && window.__embeddedData['data/config.json'];
          if (cfg && cfg.apiBase) candidates.push(String(cfg.apiBase));
        } catch (e) {}

        try {
          const urlsEmbedded = window.__embeddedData && window.__embeddedData['data/urls.json'];
          if (Array.isArray(urlsEmbedded)) candidates = candidates.concat(urlsEmbedded.map(String));
          else if (urlsEmbedded && Array.isArray(urlsEmbedded.urls)) candidates = candidates.concat(urlsEmbedded.urls.map(String));
        } catch (e) {}
        try {
          if (typeof fetch === 'function') {
            const res = await fetch('/data/urls.json', { cache: 'no-store' }).catch(() => null);
            if (res && res.ok) {
              try {
                const json = await res.json().catch(() => null);
                if (json) {
                  if (Array.isArray(json)) candidates = candidates.concat(json.map(String));
                  else if (Array.isArray(json.urls)) candidates = candidates.concat(json.urls.map(String));
                }
              } catch (e) {}
            }
          }
        } catch (e) {}

        candidates = (candidates || []).filter(Boolean).map(s => String(s));
        const uniq = [];
        for (let i = 0; i < candidates.length; i++) if (uniq.indexOf(candidates[i]) === -1) uniq.push(candidates[i]);
        candidates = uniq;

        const loadingMod = window.__builderModules && window.__builderModules['ui.loading'];
        for (let i = 0; i < candidates.length; i++) {
          const base = (candidates[i] || '').replace(/\/+$/, '');
          if (!base) continue;
          try { if (loadingMod && typeof loadingMod.show === 'function') loadingMod.show(base); } catch (e) {}

          const probeUrl = base + '/api/games';
          let ok = false;
          try {
            const controller = (typeof AbortController !== 'undefined') ? new AbortController() : null;
            const timer = controller ? setTimeout(() => { try { controller.abort(); } catch (e) {} }, 3000) : null;
            try {
              const resp = await (typeof fetch === 'function' ? fetch(probeUrl, { method: 'GET', signal: controller ? controller.signal : undefined, cache: 'no-store' }) : null).catch(() => null);
              if (resp && resp.ok) ok = true;
            } catch (e) {}
            try { if (timer) clearTimeout(timer); } catch (e) {}
          } catch (e) {}

          try { if (loadingMod && typeof loadingMod.hide === 'function') loadingMod.hide(); } catch (e) {}

          if (ok) {
            if (typeof playUrl === 'string') playUrl = base + '/' + String(playUrl).replace(/^\/+/, '');
            break;
          }
        }
      }
    } catch (e) {}

    if (!playUrl) return false;

    const headerMod = window.__builderModules && window.__builderModules['ui.header'];
    const statsMod = window.__builderModules && window.__builderModules['stats'];
    try {
      if (selectedGame && typeof window.initOwns === 'function') {
        const cfg2 = window.__embeddedData && window.__embeddedData['data/config.json'];
        const verifyOwnership2 = !(cfg2 && cfg2.verifyOwnership === false);
        const shouldVerify = !!(selectedGame.appid || selectedGame.steam_appid || selectedGame.steamAppId || selectedGame.requiresSteam) && verifyOwnership2;
        if (shouldVerify) {
          const ok = await window.initOwns(selectedGame);
          if (!ok) {
            try {
              const modal = window.__builderModules && window.__builderModules['ui.modal'];
              if (modal && typeof modal.showModal === 'function') modal.showModal({ error: 'Ownership verification failed. You do not own this game.'});
            } catch (e) {}
            return false;
          }
        }
      }
    } catch (e) {}

    if (!overlay) {
      overlay = createPlayOverlay();
      try { document.body.appendChild(overlay); } catch (e) {}
    }

    function maybeRedirectAfterClose() {
      try {
        const redirect = (window.__builderFlags && window.__builderFlags.redirect) || null;
        if (redirect) {
          try { location.href = redirect; } catch (e) { /* ignore */ }
        }
      } catch (e) {}
    }

    function onClose() {
      try { if (overlay) overlay.remove(); overlay = null; } catch (e) {}
      try { if (headerEl) headerEl.remove(); headerEl = null; } catch (e) {}
      try { statsMod && statsMod.stop(); } catch (e) {}
      try { maybeRedirectAfterClose(); } catch (e) {}
    }

    function onToggleStats() {
      try { if (statsMod) { if (statsMod.isRunning()) statsMod.stop(); else statsMod.start(); } }
      catch (e) {}
    }

    function onFullscreen() {
      try {
        const el = overlay;
        if (el.requestFullscreen) el.requestFullscreen(); else if (el.webkitRequestFullscreen) el.webkitRequestFullscreen();
      } catch (e) {}
    }

    function onOpenNew() {
      try { window.open(playUrl, '_blank'); } catch (e) {}
    }

    (function () {
      const gameTitle = (typeof input === 'string' && !/^(https?:)?\/\//.test(input)) ? (function(){
        try {
          const asNum = Number(input);
          let game = null;
          if (!Number.isNaN(asNum) && Array.isArray(window.__lastFetchedGames)) game = window.__lastFetchedGames.find(g => Number(g.id) === asNum);
          if (!game && Array.isArray(window.__lastFetchedGames)) {
            const q = String(input).toLowerCase();
            game = window.__lastFetchedGames.find(g => (g.title||'').toLowerCase() === q);
          }
          return game ? (game.title || '') : '';
        } catch (e) { return ''; }
      })() : '';

      try {
        const h = document.createElement('div');
        h.className = 'builder-mini-header';
        h.style.display = 'flex';
        h.style.justifyContent = 'space-between';
        h.style.alignItems = 'center';
        h.style.padding = '6px 8px';
        h.style.background = 'rgba(0,0,0,0.6)';
        h.style.color = 'white';
        h.style.width = '100%';
        h.style.boxSizing = 'border-box';

        const left = document.createElement('div'); left.style.display = 'flex'; left.style.alignItems = 'center';
        const title = document.createElement('div'); title.textContent = gameTitle || 'Play'; title.style.fontSize = '14px'; title.style.fontWeight = '700'; title.style.marginRight = '12px';
        left.appendChild(title);

        const right = document.createElement('div'); right.style.display = 'flex'; right.style.gap = '8px'; right.style.flexShrink = '0'; right.style.alignItems = 'center';

        function makeBtn(text, cb) { const b = document.createElement('button'); b.textContent = text; b.style.padding = '6px 8px'; b.style.borderRadius = '6px'; b.style.border = 'none'; b.style.cursor = 'pointer'; b.style.background = 'rgba(255,255,255,0.06)'; b.style.color = 'white'; b.addEventListener('click', cb); return b; }

        const fsBtn = makeBtn('⛶', onFullscreen);
        const statsBtn = makeBtn('Stats', onToggleStats);
        const closeBtn = makeBtn('✕', onClose);

        right.appendChild(fsBtn);
        right.appendChild(statsBtn);
        right.appendChild(closeBtn);

        h.appendChild(left);
        h.appendChild(right);

        headerEl = h;
        try { overlay.insertBefore(headerEl, overlay.firstChild); } catch (e) {}
        try { document.body.appendChild(overlay); } catch (e) {}
      } catch (e) {}
    })();

  overlay._iframe.src = playUrl;
  currentUrl = playUrl;
  return true;
  }

  mods[NAME] = { open };
  window.Play = { open: (u) => (mods[NAME].open(u)) };
})();


// --- src/ownsGame.js ---
// ownsGame.js

(function () {
  const API_BASE = window.API_BASE || '';
  const STEAM_BACKEND = (window.STEAM_BACKEND || window.API_BASE || 'https://steamapi.ashen-os.com').replace(/\/+$/, '');

  function storageKeyForSteam(steamid) {
    if (!steamid) return null;
    return `owned:${steamid}:${location.pathname}`;
  }

  async function fetchJson(url) {
    const res = await fetch(url, { credentials: 'include' });
    if (!res.ok) throw new Error('fetch failed: ' + res.status);
    return res.json();
  }

  async function verifyWithServer(steamid, appid) {
    const url = `${STEAM_BACKEND}/api/verify/${steamid}/${appid}`;
    const data = await fetchJson(url);
    return !!data.ownsGame;
  }

  function showOverlay(message, btnText) {
    let el = document.getElementById('ownsGameOverlay');
    if (!el) {
      el = document.createElement('div');
      el.id = 'ownsGameOverlay';
      Object.assign(el.style, {
        position: 'fixed', left: 0, top: 0, right: 0, bottom: 0,
        background: 'rgba(0,0,0,0.85)', color: '#fff', display: 'flex',
        alignItems: 'center', justifyContent: 'center', zIndex: 99999, flexDirection: 'column', padding: '1rem'
      });
      const box = document.createElement('div');
      Object.assign(box.style, { maxWidth: '720px', textAlign: 'center' });
      const msg = document.createElement('div'); msg.id = 'ownsGameMessage'; msg.style.marginBottom = '1rem';
      const btn = document.createElement('button'); btn.id = 'ownsGameButton';
      Object.assign(btn.style, { padding: '0.75rem 1.25rem', fontSize: '1rem' });
      box.appendChild(msg); box.appendChild(btn); el.appendChild(box); document.body.appendChild(el);
    }
    document.getElementById('ownsGameMessage').innerText = message;
    const b = document.getElementById('ownsGameButton');
    b.innerText = btnText || 'Verify';
    return el;
  }

  function hideOverlay() {
    const el = document.getElementById('ownsGameOverlay');
    if (el && el.parentNode) el.parentNode.removeChild(el);
  }
  async function initOwns(game) {
    if (!game) return true;
    let steamid = null;
    try {
      const saved = localStorage.getItem('steamUser');
      if (saved) {
        try { const su = JSON.parse(saved); if (su && su.id) steamid = su.id; } catch (e) {}
      }
    } catch (e) {}

    try {
      const res = await fetch(STEAM_BACKEND + '/api/me', { credentials: 'include' });
      if (res && res.ok) {
        const me = await res.json().catch(() => null);
        if (me && me.id) steamid = me.id;
      }
    } catch (e) {}

    if (!steamid && game.steamID) steamid = game.steamID;

    const key = storageKeyForSteam(steamid);
    try {
      if (key) {
        const saved = localStorage.getItem(key);
        if (saved !== null) return saved === '1';
      }
    } catch (e) { /* ignore */ }

    const overlay = showOverlay('Please verify you own this game on Steam to continue.', 'Verify ownership');
    const btn = document.getElementById('ownsGameButton');

    return new Promise((resolve) => {
      const doVerify = async () => {
        try {
          console.debug('ownsGame: starting verification', { game });
          if (!steamid) {
            try {
              const res2 = await fetch(STEAM_BACKEND + '/api/me', { credentials: 'include' });
              if (res2 && res2.ok) {
                const me2 = await res2.json().catch(() => null);
                if (me2 && me2.id) steamid = me2.id;
              }
            } catch (e) {}
          }

          const appid = game.appid || game.steam_appid || game.steamAppId;
          if (!appid) {
            overlay.querySelector('#ownsGameMessage').innerText = 'No Steam AppID provided for this game.';
            return resolve(false);
          }

          if (!steamid) {
            overlay.querySelector('#ownsGameMessage').innerText = 'Please login with Steam to verify ownership.';
            const popup = window.open(STEAM_BACKEND + '/api/login?redirect=' + encodeURIComponent(window.location.origin), 'steam-login', 'width=600,height=700');
            const user = await new Promise((resolveMsg) => {
              const handler = (ev) => {
                if (ev.data && ev.data.success && ev.data.user) {
                  window.removeEventListener('message', handler);
                  resolveMsg(ev.data.user);
                }
              };
              window.addEventListener('message', handler);
              setTimeout(() => { window.removeEventListener('message', handler); resolveMsg(null); }, 2 * 60 * 1000);
            });
            if (user && user.id) {
              steamid = user.id;
              try { localStorage.setItem('steamUser', JSON.stringify(user)); } catch (e) {}
              try { window.currentUser = user; } catch (e) {}
            }
            try { if (popup && !popup.closed) popup.close(); } catch (e) {}
          }

          overlay.querySelector('#ownsGameMessage').innerText = 'Checking ownership...';
          console.debug('ownsGame: verifying with server', { steamid, appid });
          const owns = await verifyWithServer(steamid, appid);
          try { if (key) localStorage.setItem(key, owns ? '1' : '0'); } catch (e) {}
          if (owns) {
            hideOverlay();
            resolve(true);
          } else {
            overlay.querySelector('#ownsGameMessage').innerText = 'Ownership not found. Please purchase on Steam.';
            resolve(false);
          }
        } catch (err) {
          overlay.querySelector('#ownsGameMessage').innerText = 'Error verifying ownership.';
          console.error(err);
          resolve(false);
        }
      };
      btn.addEventListener('click', doVerify, { once: true });
      try { doVerify(); } catch (e) { console.error('ownsGame: immediate verify failed', e); }
    });
  }

  window.initOwns = initOwns;
})();

